import React from 'react';
import './App.css';
import BasicTextFields from './InputBox'
import ButtonAppBar from "./appbar";
import Box from "@material-ui/core/Box";

function App() {
    return (
        <div className="App">
            <div>
                <ButtonAppBar/>
            </div>
                <Box display="flex" flexWrap="wrap">
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                    <BasicTextFields/>
                </Box>

        </div>
    );
}

export default App;
